import styled from "styled-components";
import { responsiveBorderStyle } from "../../styles/border";
import { responsiveRadiusStyle } from "../../styles/radius";
import { Box } from "../box";
import { selectableBaseStyle, selectableColorStyle } from "./style";
const Selectable = styled(Box)(responsiveBorderStyle, responsiveRadiusStyle, selectableBaseStyle, selectableColorStyle);
export {
  Selectable
};
